import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { Image } from 'primereact/image';
import { obtenerVinos } from '../services/vinoServices'; // Servicio para obtener los vinos
 //import './VinosUsers.css'; Archivo CSS para estilos adicionales

const VinosUsers = () => {
    const [vinos, setVinos] = useState([]);

    useEffect(() => {
        fetchVinos();
    }, []);

    const fetchVinos = async () => {
        try {
            const response = await obtenerVinos();
            setVinos(response.data);
        } catch (error) {
            console.error('Error al obtener vinos', error);
        }
    };

    const imageTemplate = (rowData) => {
        return (
            <Image 
                src={rowData.imagen} 
                alt={rowData.nombre} 
                width="100" 
                className="vino-image" 
                preview 
            />
        );
    };

    const bodegaTemplate = (rowData) => {
        return (
            <div>
                <p><strong>Bodega:</strong> {rowData.bodega.nombre}</p>
                <p><strong>Tipo:</strong> {rowData.tipo}</p>
            </div>
        );
    };

    return (
        <div className="p-mt-5 p-p-4 vinos-users-container" style={{ backgroundColor: '#fafafa', borderRadius: '10px' }}>
            <h1 className="p-text-center p-mb-4">Vinos Disponibles</h1>
            <DataTable value={vinos} paginator rows={5} responsiveLayout="scroll" className="p-datatable-gridlines">
                <Column header="Imagen" body={imageTemplate} />
                <Column field="nombre" header="Nombre del Vino" />
                <Column field="bodega" header="Detalles" body={bodegaTemplate} />
            </DataTable>
        </div>
    );
};

export default VinosUsers;
